import React, { useState } from 'react'

export function Counter() {
	const [likes, setLikes] = useState(0)
	function increment() {
		setLikes(likes + 1)
		console.log(likes)
	}
	function decrement() {
		setLikes(likes - 1)
		console.log(likes)
	}
	return (
		<div>
			<p>{likes}</p>
			<button onClick={increment}>Plus 1</button>
			<button onClick={decrement}>Minus 1</button>

			<input type='text' name='Login' />
		</div>
	)
}
